import React from "react";
import AdminNavbar from "./DashboardComponents/AdminDashNav";
import AdminSidebar from "./DashboardComponents/Adminsidebar";
import "./index.css";

const AdminDashboard = () => {
  return (
    <>
      <div className="contaniner-fluid">
        <div className="row">
          <AdminSidebar />
          <div className="col-md-9 dashboardmainarea">
            <AdminNavbar />
            <div className="dashboard_main_area row">
              <div className="col-md-9">
                <div className="card1">
                  <div className="cardfirst">

                  </div>
                  <div className="cardsecond">
                    <div className="cardsecond1">Number of Organizations</div>
                  <div className="cardnumeb">15</div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default AdminDashboard;
